    "2013-03-19T00:35:30.548499",nt"name": "engineering-geologic-map-of-the-alaska-highway-corridor-robertson-river-to-tetlin-junction-alas",nt"isopen":
    false,nt"url": null,nt"notes": "The engineering-geologic map is derived
    electronically, using Geographic Information System (GIS) software, from the surficial-geologic
    map of the second segment of the proposed natural gas pipeline corridor through
    the upper Tanana valley, a 12-mi-wide (19.3-km-wide) area that straddles the Alaska
    Highway through the upper Tanana River valley from the Robertson River eastward
    to near Tetlin Junction in the Tanacross Quadrangle (Reger and Hubbard, PIR 2009-6A).
    Surficial-geologic units were initially identified by interpretation of false-color
    ~1:65,000-scale infrared aerial photographs taken in July 1978, August 1980, and
    August 1981 and locally verified by field checking in 2007 and 2008. The map shows
    the distribution of surficial-geologic and bedrock units grouped genetically with
    common properties that are typically significant for engineering applications.",nt"license_title":
